import React, { Component } from "react";
import { Nav, Navbar, NavbarBrand, NavLink, NavItem } from "reactstrap";
export default class Navigation extends Component {
  render() {
    return (
      <div>
        <Navbar color="muted" light expand="md">
          <NavbarBrand href="/">Алатки за продуктивност </NavbarBrand>
          <Nav className="mr-auto" navbar>
            <NavItem>
              <NavLink href="/">Почетна</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="/categories">Категории</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="/bills">Финанскиски наплати</NavLink>
            </NavItem>

            <NavItem>
              <NavLink href="/todos">Todo</NavLink>
            </NavItem>
            <NavItem>
              <NavLink href="/user">Сметка</NavLink>
            </NavItem>
          </Nav>
        </Navbar>
      </div>
    );
  }
}
